INSERT INTO `attribute_kich_an` (`id`, `text`) VALUES
(1, 'Lời cảm ơn \nKhi nhận đòn đánh sẽ ngẫu nhiên kích hoạt né chiêu và hút 20% sát thương chuyển thành máu. Hồi chiêu:60s.'),
(2, 'Lá chắn\nKhi nhận đòn đánh sẽ ngẫu nhiên kích hoạt né chiêu và làm choáng lại đối thủ 5s.Hồi chiêu:60s.'),
(3, 'Khóa năng lượng\nKhi nhận đòn đánh sẽ ngẫu nhiên kích hoạt né chiêu và hút hết năng lượng hiện tại của đối thủ. Hồi chiêu:60s.'),
(4, 'Bộc phá\nKhi tung chiêu sẽ ngẫu nhiên kích hoạt tăng 50% sát thương. Hồi chiêu:60s.'),
(5, 'Tập trung cao độ\nKhi tung chiêu sẽ ngẫu nhiên kích hoạt liên hoàn Chí mạng trong 10s. Hồi chiêu:60s.'),
(6, 'Ma cà rồng\nKhi tung chiêu sẽ ngẫu nhiên kích hoạt biến 20% sát thương thành máu trong 5s. Hồi chiêu:60s.'),
(7, 'Đánh là choáng\nKhi tung đủ chiêu thức sẽ kích hoạt choáng đối thủ 5s. Hồi chiêu:60s.'),
(8, 'Thanh lọc\nKhi tung đủ chiêu thức sẽ kích hoạt thời gian của tất cả chiêu thức về 0.Hồi chiêu:60s.'),
(9, 'Nén đau\nKhi nhận đủ chiêu từ đối phương sẽ kích hoạt thời gian của tất cả chiêu thức về 0. Hồi chiêu:60s.'),
(10, 'Giải phóng năng lượng\nKhi nhận đủ chiêu từ đối phương sẽ kích hoạt làm choáng đối thủ trong 5s. Hồi chiêu:60s.'),
